We are trying to abort a job in FireCloud using cromwell .21. The workflow appears stuck in submitted state. It appears to have no calls. Is there are race condition that is we abort too soon the job is stuck?. ```; ~/projects/rawls [develop*] $ curl -H "Authorization: Bearer `gcloud auth print-access-token`" https://cromwell2.dsde-alpha.broadinstitute.org/api/workflows/v1/b29c0ef3-e988-4d70-8093-bdd1a039170d/status; {; "status": "Submitted",; "id": "b29c0ef3-e988-4d70-8093-bdd1a039170d"; }(dvoet@wm163-585) 14:55; ~/projects/rawls [develop*] $ curl -H "Authorization: Bearer `gcloud auth print-access-token`" https://cromwell2.dsde-alpha.broadinstitute.org/api/workflows/v1/b29c0ef3-e988-4d70-8093-bdd1a039170d/metadata; {; "submittedFiles": {; "inputs": "{"test.hello.name":"subject_HCC1143"}",; "workflow": "task hello {
 String? name

 command {
 echo 'hello ${name}!'
 }
 output {
 File response = stdout()
 }
 runtime {
 docker: "ubuntu"
 }
}

